import React from "react";
import "./App.css";
import NavBar from "./websitedesign/NavBar";
import Footer from "./websitedesign/Footer";
import AboutUs from "./websitedesign/AboutUs";
import ContactUs from "./websitedesign/ContactUs";
import Services from "./websitedesign/Services";
import Specials from "./websitedesign/Specials";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/aboutus" exact component={AboutUs} />
        <Route path="/contactus" exact component={ContactUs} />
        <Route path="/services" exact component={Services} />
        <Route path="/specials" exact component={Specials} />
      </Switch>
    </Router>
  );
}

export default App;
